    - content: >-
        Привет, читатель, не ужели тебя интересуют все пасхалки этой станции? Ну... Спасибо, что заинтересновался этим, но в следующий раз не стоит, если таков будет.


        Пока я строил эту станцию, был влюблён в одну девушку и очень хотел с ней отношений. Однако этому препятствовал мой друг... У меня часто были депресси по этому поводу и ненависть к людям и к окружающему себя коллективу, даже на стенции это отразилось. Она слишком строгая и ты сам можешь увидеть, что некоторые отделы - хорошие, плохие.

        Всё это строилось во время моей эмоциональной волны.


        Что я вообще хочу всем этим сказать? Иногда твоя жизнь является плодом твоих изобретений. Каков твой характер, эмоциональный статус и тп. - всё это влияет на твоё производство и его качество..

        Будь собой и не позволяй сделать жизни то, что произошло со мной..


        1/4
