    - content: >-
        Nanotrasen начала существование как маленькая компания, исследующая, в основном, область генной терапии в самом сердце космоса человечества — на Марсе. Это произошло незадолго до серии скандалов из-за того, что клонирование было зарезервировано для богатых, а не для промышленников в наиболее благополучной части Сол — Nanotrasen была эффективна в патентовании методов, которые привели к более экономичным планам покрытия для использования в бизнесе, в первую очередь за счет агрессивных бизнес-тактик, а не личных исследований. Nanotrasen была взращена коллективом акул, как личностей настаивающих на своей проницательной деловой тактике. К концу десятилетия Nanotrasen превратилась в межзвёздную сущность.


        В конце 22 века, была открыта плазма. Nanotrasen и её конкуренты, естественно самые передовые корпорации, были заняты попытками добывать этот ценный ресурс, и все они установили многочисленные космические станции у плазменных гигантов, чтобы добывать ресурс. Это только дало толчок экономике, и, так называемая, «фиолетовая лихорадка» началась с участием всех корпораций пытающихся найти так много применений ценной плазмы, как только возможно, в целях извлечения прибыли, в основном от человеческих правительств. Удачно названная оранжевая лихорадка дала возможность выявить большое количество плазмы на Марсе. Исследовательские предприятия, станции, корабли и другие установки создавались быстрее чем когда-либо. Nanotrasen была самой кровожадной корпорацией, обанкротила и поглотила множество других компаний в большем масштабе, чем когда-либо прежде. Многие ощутили, что единственная определяющая способность Nanotrasen состоит в том, чтобы извлечь выгоду из тяжелого труда других — и это ощущение отнюдь не ложное. Впрочем, это только увеличило силу и сферу влияния Nanotrasen, вознеся её до статуса настоящей супер-корпорации, в конечном итоге ставшей самой обширной бизнес-империи в галактике.
